window.bookSummaryJSON = "<p><b>An alien race&nbsp;attacked her people...they wanted her world. Now, payback is coming after them. And she’s a&nbsp;bitch&nbsp;in every sense of the word.</b></p> <p><b>From Amazon Top 100 Best-selling Author....</b></p> <p>Bethany Anne Nacht was changed on Earth almost 200 years in the past.</p> <p>The Kurtherians engage in the cosmic great game, where whole&nbsp;worlds&nbsp;are torn asunder in their efforts to prove their own supremacy.</p> <p>For hundreds of millennia, the Kurtherians at the top have reigned unfettered as they destroyed countless civilizations time and time again.</p> <p>Now, a new group is entering the game.</p> <p>Bethany Anne and her people are playing against extreme odds, but when has that&nbsp;ever&nbsp;stopped the Queen Bitch?</p> <p>It’s time to fight for the future of the universe....</p> <p>Are you ready?</p> <p><i>Note: This book contains cursing, perhaps humorous cursing, but cursing, nevertheless. If this offends you, I don't suggest listening to this book.</i></p>"; 
